$5.00

** Link in bio **

NoFaceForgetIt hops onto a 4hr flight to Kiev, Ukriaine in -6 degree weather, and rides a coach to Pripyat in the former Soviet Union. There, at Chernobyl in 1986 was the worst nuclear disaster excepting Fukushima.

In The Zone is filled with detailed photographs of industrial decay on an epic scale. The towering perimeter fence built of crisscrossing metal bars, protecting the area of worst radiation. Views from inside a cooling tower. The odd infrastructure of small towns; carnival rides, churches, gyms, doctors offices, and a wooden storefront painted with folk cartoons from an era when people used to live there.

This is a quiet zine to be read late at night or early in the morning, when everyone else is sleeping. Look at it again while thinking of pandemics, climate change, and overpopulation. Think of insects and microbes. Then think of us.

first edition of 100

20 pages full color printing on heavy laser stock with a 250gsm cover. - 8.25" x 5.75"

